INSERT INTO `laboratories` (`id`, `exam`, `slug`, `icon`, `synonymous`, `clinical_use`, `preparation`, `meaning`, `range`, `method`, `json`, `user_id`, `deleted_at`, `created_at`, `updated_at`) VALUES
(1, 'ACIDO URICO', 'acido-urico', 'fa-stethoscope', 'Trihidroxipurina Purina triol HS', 'En diagnóstico y tratamiento de fallo renal y monitoreo de pacientes que reciben medicamentos citotóxicos así como en variedad de desórdenes tales como gota leucemia psoriasis inanición y otras condiciones debilitantes.', 'Muestra de sangre No se requiere ayuno', 'El ácido urico es el producto final del metabolismo de las purinas en los seres humanos. La purinas son componentes vitales de los ácidos nucleicos y coenzimas se pueden sintetizar en el cuer', 'H: 34 a 7 mg/dl M:24 a 57 mg/dl', 'colorimetria', '', 3, NULL, '0000-00-00 00:00:00', '2018-05-04 04:05:47'),
(2, 'ALBUMINA EN SANGRE', '', 'fa-stethoscope', 'no', 'La albúmina es una proteína que se encuentra en gran proporción en el plasma sanguíneo, siendo la principal proteína de la sangre, y una de las más abundantes en el ser humano. Se sintetiza en el hígado.La albúmina es una proteína que se encuentra en gran proporción en el plasma sanguíneo, siendo la principal proteína de la sangre, y una de las más abundantes en el ser humano. Se sintetiza en el hígado.', 'Muestra de sangre No se requiere ayuno', 'La hipoalbuminemia se debe a varios factores: disminución en la síntesis por enfermedad hepática (primaria) o por baja ingesta de proteínas (secundaria); aumento del catabolismo por daño en t', '0-11 meses: no establecido Mayores de un año: 3.5-5.0 g/dl', 'none', '', 3, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(3, 'ASTOS', 'astos', 'fa-stethoscope', 'ASO, Anticuerpos Antienzimas Estreptocóccicas, Titulo ASLO', 'La Antiestreptolisina O se utiliza para confirmar la exposición a Streptococcus pyogenes en ausencia de otras pruebas de laboratorio.', 'Muestra de sangre Es preferible tomar la muestra en ayunas', 'La estreptolisina O es una exoenzima inmunogénico tóxico producido por estreptococos beta-hemolíticos de los Grupos A, C y G. La cuantificación de los anticuerpos ASO se utiliza para el diagn', 'Menor a 200 UI/mL', 'aglutinación latex', '', 3, NULL, '0000-00-00 00:00:00', '2018-06-07 08:08:06'),
(4, 'AMILASA EN ORINA', 'amilasa-en-orina', 'fa-stethoscope', 'amilasuria', 'Diagnóstico y seguimiento de pancreatitis aguda.', 'Recolección de una muestra de orina al azar. Para muestras con tiempo controlado se requiere el tiempo de recolección y volumen recolectado.', 'El aclaramiento de la amilasa en orina se incrementa aprox. 3 veces en 1 -2 semanas en pacientes con pancreatitis aguda. Una cantidad significativa de amilasa sérica se excreta en la orina y ', 'Amilasuria al azar: 32-641 U/L', 'none', '', 3, NULL, '0000-00-00 00:00:00', '2018-06-07 08:10:24'),
(5, 'AMILASA EN SANGRE', 'amilasa-en-sangre', 'fa-stethoscope', 'amilasemia', 'Diagnóstico y manejo de pancreatitis.', 'Muestra de sangre No se requiere ayuno', 'En pancreatitis aguda ocurre una elevación transitoria de la actividad sérica de la amilasa a las 1 ó 2 horas de iniciado el cuadro. A las 12-72 horas ocurre una elevación de la actividad de ', '\"1-19 años: 30-100 U/LMayores de 20 años: 30-110 U/L\"', 'none', '', 3, NULL, '0000-00-00 00:00:00', '2018-06-07 08:11:42'),
(6, 'ANTIBIOGRAMA MANUAL CULTIVO', 'antibiograma-manual-cultivo', 'fa-stethoscope', 'PSA (Prueba de sensibilidad a antibióticos)', 'Determinación de la sensibilidad a antibióticos del microorganismos aislado para elección de terapia dirigida.', 'Muestra de cultivos por bacterias Evitar el uso de antibióticos al menos 4 días antes de la toma de la muestra', 'Según el patrón de resistencia presentado por el microorganismo se debe o no variar la terapia de antibióticos empleada.', 'none', 'none', '', 3, NULL, '0000-00-00 00:00:00', '2018-06-07 08:12:18'),
(7, 'ANTICUERPOS ANTINUCLEARES', 'anticuerpos-antinucleares', 'fa-stethoscope', 'Factor Antinuclear (FAN) ANA Factor Antinucleo AAN', 'Anticuerpo Antinuclear (ANA) es un término general que se emplea para referirse a los anticuerpos dirigidos contra diversas proteinas del nucleo celular. En la actualidad se considera que la detección de ANA constituye una herramienta general para la detección selectiva de las enfermedades del tejido conjuntivo.', 'Muestra de sangre No se requiere ayuno', 'Los Anticuerpos antinucleares (ANA) son autoanticuerpos que tienen como blanco el contenido del núcleo celular. La concentración de anticuerpos antinucleares está significativamente aumentada', 'Positivo: >ó= 1:40Positivo: >ó= 1:40Negativo: < 1:40', 'Inmunocromatografica', '', 3, NULL, '0000-00-00 00:00:00', '2018-06-07 08:13:20'),
(8, 'ANTIGENO CARCINOEMBRIONARIO', 'antigeno-carcinoembrionario', 'fa-stethoscope', 'CEA', 'Los niveles de antígeno carcinoembrienico (CEA) se pueden encontrar elevados en algunas enfermedades no malignas como enfermedades hepáticas lesiones inflamatorias especialmente del tracto digestivo infecciones traumas infartos enfermedad vascular y del colágeno daño renal y el fumado.\r\nConcentraciones elevadas se han encontrado también en enfermedades benignas colorrectales (17%) estómago (gastritis crOnica y úlcera póptica 14%) hígado (cirrosis y hepatitis 17%) y páncreas (21%).\r\nNiveles elevados de CEA se pueden encontrar una serie de diferentes tipos de tumores entre ellos del tracto gastrointestinal pulmón mama ovario y útero.', 'Muestra de sangre No se requiere ayuno', 'El CEA es un marcador tumoral que comprende un grupo de glicoproteínas de 175 - 200 kD y su nombre se debe a que originalmente se creía que solo se encontraba en carcinomas gastrointestinales', 'No Fumadores de 0.37 hasta 3.3 ng/mLFumadores de 0.52 hasta 6.30 ng/Ml', 'none', '', 3, NULL, '0000-00-00 00:00:00', '2018-06-07 08:14:36'),
(9, 'ALCOHOL EN ALIENTO Y EN SALIVA', 'alcohol-en-aliento-y-en-saliva', 'fa-stethoscope', 'none', 'En una muestra de aire o saliva se va a verificar quí cantidad de alcohol en sangre tiene la persona. Pero sin embargo lo que se mide es la concentración de alcohol en el aire que se expira.', NULL, NULL, 'NEGATIVO', 'none', '', 3, NULL, '0000-00-00 00:00:00', '2018-06-07 08:15:36'),
(10, 'ANTIGENO PROSTATICO ESPECIFICO CUANTITATIVO', 'antigeno-prostatico-especifico-cuantitativo', 'fa-stethoscope', 'Antígeno prostático especifico APE APE Total PSA', 'Evaluación de pacientes con problemas de próstata. Monitoreo de pacientes con historial de cancer como indicador de recurrencia y de respuesta al tratamiento', 'Muestra de sangre No requiere ayuno No realizar análisis luego de biopsia transrectal: falsos positivos', 'El APE es una glicoproteina producida por la glándula prostatica. Normalmente una pequeña cantidad de PSA es secretada en la sangre. un aumento en el tamaño de la próstata por hiperplasia pro', 'none', 'Inmunoquimioluminiscencia', '', 3, NULL, '0000-00-00 00:00:00', '2018-06-07 08:16:42'),
(11, 'AZUCARES REDUCTORES', 'azucares-reductores', 'fa-stethoscope', 'Sustancias reductoras en heces', 'Son de gran importancia en diarreas de infantes especialmente cuando hay intolerancia de carbohidratos o una mala absorción de los mismos.', 'Muestra de heces No requiere preparación previa\r\nSi se quiere recolectar una muestra de un niño que utiliza paciales se recomienda colocar plástico entre el niño y el parcial para evitar la absorción de la humedad de la muestra O COLOCAR EL PACIAL AL REVES No son aceptables muestras con más de 2 horas a temperatura ambiente muestras con más de 1 día en refrigeración y muestras diarreicas recolectadas directamente en el parcal u otras superficies absorbentes\r\nSe debe de tener', 'Los azúcares son rapidamente absorbidos por la porción superior del intestino delgado. Sin embargo pueden permanecer en el intestino y causar diarreas ocasionadas por la presion osmitica de l', 'NEGATIVO', 'BENEDICT', '', 3, NULL, '0000-00-00 00:00:00', '2018-06-07 08:20:13'),
(12, 'BACILOSCOPIA', 'baciloscopia', 'fa-stethoscope', 'none', 'La baciloscopia es una prueba que se utiliza en medicina para detectar la presencia de bacilos en una muestra determinada. Se aplica principalmente para la busqueda del bacilo de Kocha(Mycobacterium tuberculosis) agente de la tuberculosis en una muestra de esputo en este caso el procedimiento se llama baciloscopia de esputo.', NULL, 'La baciloscopia es uno de los principales procedimientos médicos que se utilizan para llegar al diagnóstico de tuberculosis. Cuando se sospecha tuberculosis pulmonar se realiza baciloscopia d', 'none', 'none', '', 3, NULL, '0000-00-00 00:00:00', '2018-06-07 08:23:21'),
(13, 'BARBITURICOS', 'barbituricos', 'fa-stethoscope', 'BARBITURATOS', 'Determinar el uso o abuso de esta droga.', 'de orina Se recomienda abstenerse de orinar por lo menos cuatro horas antes de la prueba', 'Los barbituratos son drogas que actian como depresores del nivel del sistema nervioso central. Poseen varios efectos que van desde sedativos hasta anestásicos. Se utilizan como ansiolíticos h', 'NEGATIVO', 'EIA', '', 3, NULL, '0000-00-00 00:00:00', '2018-06-07 08:25:05'),
(14, 'BENZODIAZEPINA', 'benzodiazepina', 'fa-stethoscope', 'Diazepam (Valium) chlordiazepoxide (Librium) oxazepam (Serax) lorazepam (Ativan) alprazolam (Xanax) clonazepam (Clonopin) y triazolam (Halcion)', 'Determinar el uso o abuso de esta droga.', 'tomar muestra de orina vigilada no requiere ayunoMuestra de orina Se recomienda abstenerse de orinar por lo menos cuatro horas antes de la prueba', 'Las benzodiacepinas son ampliamente utilizadas como ansioliticos sedantes relajadores musculares y anticonvulsionantes.', 'Negativo', 'Inmunoensayo enzimático', '', 3, NULL, '0000-00-00 00:00:00', '2018-06-07 08:26:05'),
(16, 'CELULAS LE', 'celulas-le', 'fa-stethoscope', 'LES Analisis para Lupus Eritermatoso SLE', 'Determinar la presencia de anticuerpos más frecuentemente encontrados contra la proteina desoxirribonucléica en la enfermedad del Lupus Eritematoso Sistémico.', 'Muestra de sangre No se requiere ayuno', 'El Lupus Eritematoso Sistémico (LES) se clasifica como el prototipo de una enfermedad autoinmune severa involucrando una gran variedad de tejidos y asociados con una gran variedad de anticuer', 'NEGATIVO', 'AGLUTINACION EN LATEX', '', 3, NULL, '0000-00-00 00:00:00', '2018-06-07 08:27:10'),
(17, 'BILIRRUBINA TOTAL Y DIRECTA', 'bilirrubina-total-y-directa', 'fa-stethoscope', 'BILIRRUBINA TOTAL Y DIRECTA', 'Es un examen que mide los niveles de bilirrubina en la sangre. La bilirrubina es una sustancia amarillenta que se forma durante el proceso normal de descomposición de los glóbulos rojos por el cuerpo. La bilirrubina se encuentra en la bilis un líquido segregado por el hígado que ayuda a digerir los alimentos. Cuando el hígado funciona normalmente elimina la mayoria de la bilirrubina del cuerpo. Si el hígado está dañado la bilirrubina puede salirse del hígado y pasar a la sangre. El exceso de bilirrubina en la sangre puede provocaraictericia que hace que la piel y los ojos se vuelvan amarillos. La aparición de ictericia y el examen de bilirrubina en sangre permiten que su médico o profesional de la salud determine si usted tiene una enfermedad del hígado.', 'Muestra de sangre No se requiere ayuno', 'El examen de bilirrubina en sangre se usa para examinar la salud del hígado. También se usa compnmente para diagnosticar ictericia en reción nacidos. Muchos bebés saludables tienen ictericia ', 'none', 'none', '', 3, NULL, '0000-00-00 00:00:00', '2018-06-07 08:28:29'),
(18, 'CALCIO ION', 'calcio-ion', 'fa-stethoscope', 'CALCIO ION', 'Es un análisis que mide el nivel de calcio en la sangre', 'Muestra de sangre No se requiere ayuno', 'Todas las ccélulas necesitan calcio para trabajar. El calcio ayuda a desarrollar huesos y dientes fuertes. Es importante para la función cardíaca y ayuda con la contracción muscular las señal', '8.5 a 10.2 mg/dL', 'colorimetria', '', 3, NULL, '0000-00-00 00:00:00', '2018-06-07 08:30:26'),
(19, 'CANNABINOIDES (MARIHUANA )', 'cannabinoides-marihuana', 'fa-stethoscope', 'MARIHUANA', 'Determinar el uso de esta droga', 'tomar muestra de orina vigilada no requiere ayunoMuestra de orina Se recomienda abstenerse de orinar por lo menos cuatro horas antes de la prueba', '8.5 a 10.2 mg/dL', 'NEGATIVO', 'METODO INMUNO ENZIMATICO', '', 3, NULL, '0000-00-00 00:00:00', '2018-06-07 08:31:42'),
(20, 'COCAÍNA METABOLITOS EN ORINA', 'cocaina-metabolitos-en-orina', 'fa-stethoscope', 'NO', 'Determinación del uso de la droga.', 'tomar muestra de orina vigilada no requiere ayunoMuestra de orina Se recomienda abstenerse de orinar por lo menos cuatro horas antes de la prueba', 'COCAÍNA METABOLITOS EN ORINA', 'NEGATIVO', 'METODO INMUNO ENZIMATICO', '', 3, NULL, '0000-00-00 00:00:00', '2018-06-07 08:33:02'),
(21, 'COLESTEROL HDL', 'colesterol-hdl', 'fa-stethoscope', 'Lipoproteinas de Alta Densidad Colesterol bueno', 'Evaluación del riesgo cardiovascular.', 'Muestra de sangre Requiere ayuno de 12-14 horas', 'Los niveles bajos de HDL pueden ser un signo de aumento del riesgo de cardiopatia ateroescleritica. Un nivel de HDL bajo también puede estar asociado con Hiperlipidemia familiar combinada Dia', 'Bajo HDL: <40 mg/dL Normal: 40-60 mg/dLDeseable: >60 mg/Dl', 'calculado', '', 3, NULL, '0000-00-00 00:00:00', '2018-06-07 08:34:00'),
(22, 'COLESTEROL TOTAL', 'colesterol-total', 'fa-stethoscope', 'Colesterolemia', 'Evaluación del riesgo cardiovascular.', 'Muestra de sangre Requiere ayuno de 12-14 horas', 'El colesterol total se eleva en las hiperlipoproteinemias hereditarias y en varios desordenes metabolicos. En la enfermedad hepática colestásica se observan valores de moderados a muy elevado', 'Deseable: < 200 mg/DlLímite superior: 200-239 mg/dLAlto: > A = 240 mg/dL', 'colorimetria', '', 3, NULL, '0000-00-00 00:00:00', '2018-06-07 08:35:10'),
(23, 'COLINESTERASA SéRICA', 'colinesterasa-serica', 'fa-stethoscope', 'Colinesterasa sérica Pseudocolinesterasa', 'Monitoreo de exposición a insecticidas organofosforados monitoreo de pacientes con enfermedad hepática particularmente aquellos sometidos a transplante de hígado. Identificación de pacientes que son homocigotas o heterocigotas para un gen atipico y que tienen valores disminuidos de pseudocolinesterasa.', 'Muestra de sangre No se requiere ayuno', 'La disminución en los niveles de colinesterasa puede deberse a infección aguda desnutrición crínica ataque cardíaco daño hepático metástasis ictericia obstructiva e intoxicación con organofos', 'Hombres: 5900 - 12220 U/LMujeres: 4650 - 10440 U/L', 'cinetico', '', 3, NULL, '0000-00-00 00:00:00', '2018-06-07 08:36:40'),
(24, 'COLINESTERASA ERITROCITARIA', '', 'fa-stethoscope', '', 'La actividad de la colinesterasa en ccélulas rojas humanas es altamente específica pero no exclusiva de la acetilcolina. Es llamada colinesterasa específica. La actividad de la colinesterasa presente en el plasma hidrolisa tanto la colina como los esteres alifoticos demostrando un rango más amplio de actividad esterolitica conocido como pseducolinesterasa o colinesterasa no específica. Esta hidrolisa la acetilcolina lentamente. El nombre sistemítico para la acetilcolinesterasa es acetilcolina acetilhidrolasa. El nombre sistemítico para la colinesterasa (en plasma) es acilcolina acilhidrolasa.', 'Muestra de sangre No se requiere ayuno', 'La colinesterasa eritrocitaria es utilizada para el diagnóstico de toxicidad por organofosforados y carbamatos y para detectar formas atípicas de la enzima. La colinesterasa es irreversibleme', '7.9 - 12 U/ml', 'enzimatico', '', 3, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(25, 'COPROLOGICO', '', 'fa-stethoscope', 'COPROANALISIS', 'Análisis Coprologico Parasitario se centra en la tercera es decir su objetivo es la detección en un paciente concreto de la existencia de parasitismo intestinal o de glándulas anejas pudiéndose revelar también parasitismos localizados en órganos y sistemas muy alejados del intestino siempre que los parasitos productores de los mismos empleen la via fecal del hospedador para eliminar los elementos que le sirven para su diseminación por la naturaleza.', '', 'El Análisis Coprológico Parasitario se basa en la identificación microscópica en muestras fecales del sospechoso de los elementos parasitarios presentes en ellas. Teniendo esto en cuenta se p', 'none', 'none', '', 3, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26, 'COPROCULTIVO', 'coprocultivo', 'fa-stethoscope', 'COPROCULTIVO', 'El coprocultivo es un examen de laboratorio para encontrar Micro organismos en las heces (materia fecal) como salmonella y shiguella que puedan causar enfermedad y síntomas gastrointestinales.', NULL, 'Este examen se realiza cuando el médico sospecha que usted puede tener una infección gastrointestinal. Asimismo se puede llevar a cabo si usted presenta diarrea intensa que no desaparece o qu', 'none', 'none', '', 3, NULL, '0000-00-00 00:00:00', '2018-06-07 08:38:00'),
(27, 'COPROSCOPICO', 'coproscopico', 'fa-stethoscope', 'COPROSCOPICO', 'El examen coprologico funcional es un conjunto de pruebas que brindan información oportuna y de fácil acceso sobre la fisiopatologia digestiva especialmente dirigida a patologías relacionadas con: pérdida de peso diarreas cronicas desnutrición  malnutrición pancreopatia procesos inflamatorios intestinales anemia macro - microciticas y hemorragias. La prueba se realiza en tres fases: La fase Macroscopica consiste en reportar las características físicas de la muestra (forma consistencia color aspecto presencia de sangre o moco) La fase Química consiste en analizar varios parámetros como el pH la presencia de almidón sustancias reductoras sangre oculta grasas entre otras. La fase Microscópica la muestra es analizada para identificar y cuantificar ccélulas inflamatorias (leucocitos) bacterias hongos el tipo de fibras que predominan como producto del metabolismo del aparato digestivo u otros elementos anormale', NULL, 'Este análisis es de gran utilidad cuando se trata de demostrar problemas de mala digestión  malabsorción o parasitosis intestinales. Este examen debe incluir examenes tanto macroscópicos como', 'none', 'none', '', 3, NULL, '0000-00-00 00:00:00', '2018-06-07 08:53:44'),
(28, 'CREATININA', 'creatinina', 'fa-stethoscope', 'Creatinina sérica', 'Evaluación del funcionamiento renal.', 'Muestra de sangre No requiere ayuno', 'Los niveles superiores a lo normal pueden ser indicio de Necrosis tubular aguda deshidratación nefropatía diabetica eclampsia glomerulonefritis insuficiencia renal distrofia muscular preeclam', 'none', 'Cinitico de 2 puntos / VITROS 250', '', 3, NULL, '0000-00-00 00:00:00', '2018-06-07 08:54:37'),
(29, 'CUADRO HEMATICO', 'cuadro-hematico', 'fa-stethoscope', 'HEMOGRAMA', 'El cuadro hematico es un examen de laboratorio que se ordena con frecuencia. Es un conjunto de examenes que sirven para medir algunas de las diferentes partes de la sangre. La sangre está compuesta por los eritrocitos (glóbulos rojos) los leucocitos (glóbulos blancos) las plaquetas y el plasma. La parte principal de Los glóbulos rojos es la hemoglobina. La hemoglobina contiene oxigeno y hierro. Los glóbulos rojos llevan la hemoglobina a las ccélulas del cuerpo y eliminan los desechos como el dióxido de carbono. Los glóbulos blancos son los encargados de combatir las infecciones. Existen distintas clases de glóbulos blancos. Las cantidades de cada clase de glóbulos blancos ayudan a que los médicos decidan el tratamiento de las infecciones. Las plaquetas el plasma y otras proteínas en la sangre ayudan a coagular su sangre cuando usted se corta o lesiona.', 'NO SE REQUIERE AYUNO', 'El cuadro hematico se hace generalmente cuando a usted le hacen un chequeo médico. También se hace para conocer su estado de salud antes de una cirugía. El cuadro hematico sirve para saber po', 'none', 'AUTOMATIZADO TIPO 4', '', 3, NULL, '0000-00-00 00:00:00', '2018-06-07 08:55:17'),
(30, 'CULTIVOS ESPECIALES PARA MICROORGANISMOS', 'cultivos-especiales-para-microorganismos', 'fa-hourglass-3', 'NO', 'Determinación de infección bacteriana', 'Evitar el uso de antibióticos al menos 4 días antes de la toma de la muestra', 'Según la especie aislada y sitio anatemico del aislamiento.', 'NEGATIVO', 'CULTIVO', '', 3, NULL, '0000-00-00 00:00:00', '2018-06-08 09:33:14'),
(31, 'CULTIVO PARA MYCOBACTERIAS', 'cultivo-para-mycobacterias', 'fa-stethoscope', 'Cultivo por micobacterias Cultivo por TB', 'Determinación de tuberculosis pulmonar o sistémica.', 'Muestra de Esputo: Tomar muestra por la mañana en ayunas Tras un enjuague bucal Aspirado gastrico: se debe tomar la muestra en las primeras horas de la mañana', 'Un cultivo positivo no implica que se padezca tuberculosis hasta que se confirme la especie del microorganismo mediante pruebas bioquímicas.', 'NEGATIVO', 'Cultivo en medio Loweinstein Jensen', '', 3, NULL, '0000-00-00 00:00:00', '2018-06-07 08:57:45'),
(32, 'DROGAS SCREEN 2 5 Y 10 SUSTANCIAS', 'drogas-screen-2-5-y-10-sustancias', 'fa-stethoscope', 'DROGAS SCREEN 2 5 Y 10 SUSTANCIAS', 'Determinación de diferentes drogas en orina', 'tomar muestra de orina vigilada no requiere ayuno', 'DROGAS SCREEN 2 5 Y 10 SUSTANCIAS', 'none', 'none', '', 3, NULL, '0000-00-00 00:00:00', '2018-06-07 08:59:19'),
(33, 'FACTOR REUMATOIDEO', 'factor-reumatoideo', 'fa-stethoscope', 'Factor ReumaticoFactores Reumatoides FR RF Anticuerpos contra Artritis Reumática.', 'Detección cualitativa y semicuantitativa de factores reumatoides (FR) en suero humano.', 'Muestra de sangre No requiere ayuno Edad y sexo del paciente requerido', 'Los factores reumatoides son un grupo de anticuerpos dirigidos contra la fracción Fc de las inmunoglobulinas G. Aunque se hallan presentes en un gran número de desordenes reumáticos tales com', 'Positivo mayor o igual a 8UI/mL de factores reumatoides.', 'AGLUTINACION EN LATEX', '', 3, NULL, '0000-00-00 00:00:00', '2018-06-07 09:00:49'),
(34, 'FOSFATASA ACIDA', 'fosfatasa-acida', 'fa-stethoscope', 'Fosfatasa acida prostatica isoenzima prostatica soft-PACP', 'Para predecir la recurrencia de cáncer de próstata luego de prostatectomía radical. Para el monitoreo de la efectividad de los tratamientos.', 'Muestra de sangre Se debe evitar realizar el análisis en la semana posterior a la realización de masaje prostático', 'Niveles elevados en pacientes con historial de cáncer de próstata pueden indicar progresión del tumor o recurrencia. También se eleva en hiperplasias prostaticas benignas infarto prostático y', '0 - 35 UI/L', 'Quimioluminiscencia', '', 3, NULL, '0000-00-00 00:00:00', '2018-06-07 09:01:55'),
(35, 'FOSFATASA ALCALINA', 'fosfatasa-alcalina', 'fa-stethoscope', 'NO', 'Diagnostico y tratamiento de enfermedades del hígado hueso intestino y paratiroides.', 'Muestra de sangre Requiere 8 horas de ayuno', 'Los niveles superiores a los normales pueden deberse a obstrucción biliar enfermedad osea ingerir una comida grasosa o si tiene el tipo de sangre O A B consolidación de una fractura hepatitis', 'A 37 AC HASTA 270u/l', 'CINETICO', '', 3, NULL, '0000-00-00 00:00:00', '2018-06-07 09:02:35'),
(36, 'FROTIS FARINGEO GRAM', 'frotis-faringeo-gram', 'fa-stethoscope', 'FROTIS FARINGEO GRAM', 'Un cultivo de exudado faríngeo o prueba estreptococica se hace frotando la garganta con un hisopo para detectar la presencia de bacterias deíStreptococcus del grupo A la causa más frecuente de la faringitis estreptococica. Estas bacterias también pueden causar otras infecciones como la escarlatina los abscesos y la pulmonía.', 'tomar raspado de garganta en ayunas', 'La faringitis estreptococica es una infección bacteriana que afecta a la parte posterior de la garganta y las amígdalas que se inflaman e irritan lo que provoca un dolor de garganta al tragar', 'none', 'none', '', 3, NULL, '0000-00-00 00:00:00', '2018-06-07 09:03:34'),
(37, 'FROTIS DE SANGRE PERIFERICA', 'frotis-de-sangre-periferica', 'fa-stethoscope', 'FSP  ESP', 'De acuerdo con las buenas practicas de hematología el extendido de sangre periférica está indicado en todos los hemogramas que muestren alguna desviación en los recuentos directos indirectos o calculados o cuando se sospeche clinicamente una enfermedad de origen hematológico o de origen no hematológico con manifestaciones hematológicas aun con parámetros entre los rangos esperados', NULL, 'FROTIS DE SANGRE PERIFERICA', 'none', 'none', '', 3, NULL, '0000-00-00 00:00:00', '2018-06-07 09:04:17'),
(38, 'FSH HORMONA FOLICULO ESTIMULANTE', '', 'fa-stethoscope', '', '', '', '', 'none', 'none', '', 3, NULL, '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(39, 'GAMMA GT', 'gamma-gt', 'fa-stethoscope', 'Gama Glutamil Transpeptidasa', 'Diagnóstico y monitoreo de enfermedad hepatobiliar. Puede ser usada para corroborar si las elevaciones en la fosfatasa alcalina corresponden a problemas óseos o reflejan la presencia de enfermedad hepatobiliar (GGT elevada). También se usa para monitoreo de alcoholismo.', 'Muestra de sangre No requiere ayuno', 'Los niveles de GGT superiores al normal pueden indicar alcoholismo bloqueo del flujo desde el hígado (colestasis) insuficiencia cardíaca hepatitis isquemia hepática (falta de flujo de sangre)', 'none', 'CINETICO', '', 3, NULL, '0000-00-00 00:00:00', '2018-06-07 09:05:06'),
(40, 'GLICEMIA', 'glicemia', 'fa-stethoscope', 'Glucemia glucosa azúcar en sangre', 'Los niveles de glucosa son utilizados para el diagnóstico y manejo de Diabetes Mellitus y de otros desordenes del metabolismo de carbohidratos que incluyen Diabetes gestacional hipoglicemia neonatal hipoglicemia idioptica y carcinoma de islotes de Langerhans.', 'Muestra de sangre Requiere 8 a 14 horas de ayuno', 'Cualquiera de los siguientes resultados confirmado en un día subsecuente puede ser considerado diagnóstico de DM: \r\n-Glucosa en ayunas > o = 126 mg/dL posterior a 8 a 14 horas de ayuno.\r\n-Glu', 'none', 'COLORIMETRICO', '', 3, NULL, '0000-00-00 00:00:00', '2018-06-07 09:05:47'),
(41, 'HELYCOBACTER PYLORI', 'helycobacter-pylori', 'fa-stethoscope', 'H. pylori HPSA Helicobacter pyloriúen heces', 'Para el diagnóstico de Helicobacter pylori y el monitoreo de la terapia de eliminación para el mismo', 'Muestra de heces Presentar una vez concluido el tratamiento con antimicrobiano bismuto o inhibidores de bomba de protones 2 semanas antes de realizar esta prueba', 'Un resultado positivo indica la presencia de H. pylori en las heces. Si el resultado es negativo no se descarta la presencia de la bacteria a nivel de estómago.', 'none', 'EIC', '', 3, NULL, '0000-00-00 00:00:00', '2018-06-07 09:06:28'),
(42, 'HEMOCLASIFICACION', 'hemoclasificacion', 'fa-stethoscope', 'Grupo ABO Factor Rh', 'Para seleccionar componentes sanguíneos compatibles para la terapia transfuncional', 'Muestra de sangre no requiere ayuno', 'HEMOCLASIFICACION', 'none', 'aglutinacion manual', '', 3, NULL, '0000-00-00 00:00:00', '2018-06-07 09:07:28'),
(43, 'HBSAG ANTíGENO HEPTITIS B TAMIZAJE', 'hbsag-antigeno-heptitis-b-tamizaje', 'fa-stethoscope', 'HBSAG ANTíGENO HEPTITIS B TAMIZAJE', 'Tamizaje para hepatitis B', 'Muestra de sangre', 'presencia es indicativo de infección por hepatitis B aguda o crónica.', 'none', 'eic', '', 3, NULL, '0000-00-00 00:00:00', '2018-06-07 09:08:40'),
(44, 'HEPATITIS B ANTI HBS ANTICUERPOS TAMIZAJE', 'hepatitis-b-anti-hbs-anticuerpos-tamizaje', 'fa-stethoscope', 'Hepatitis B Anti-HBsAg', 'Evaluar una posible inmunidad en personas con un mayor riesgo de exposición al virus de Hepatitis B. Se utiliza en personas que sufrieron lesiones con agujas ya utilizadas así como para darle seguimiento al estado inmune de las personas luego de la vacunacion contra el virus de la Hepatitis B.', 'Muestra de sangre No se requiere ayuno', 'Los anticuerpos contra el antígeno de superficie de la Hepatitis B son indicador de recuperación clinica y por lo tanto de inmunidad hacia el virus', 'none', 'eia', '', 3, NULL, '0000-00-00 00:00:00', '2018-06-07 09:12:45'),
(45, 'HEMOGLOBINA GLICOSILADA', 'hemoglobina-glicosilada', 'fa-stethoscope', 'HbA1c', 'La hemoglobina A1c se forma por glicación no enzimática del término N de la cadena b de la hemoglobina Ao. El nivel de hemoglobina A1c es proporcional al nivel de glucosa en sangre durante un período de aproximadamente dos meses. Por consiguiente la hemoglobina A1c se acepta como un indicador de la concentración de glucosa en sangre diaria media durante los dos meses anteriores. A partir del 2010 la Asociación Americana de Diabetes recomienda el uso de la HbA1c para el diagnóstico de la diabetes.', 'Muestra de sangre No requiere ayuno', 'HEMOGLOBINA GLICOSILADA', 'none', 'Inhibición de la inmunoaglutinación de partículas de latex', '', 3, NULL, '0000-00-00 00:00:00', '2018-06-07 09:13:46'),
(60, 'RECUENTO DE RETICULOCITOS', 'recuento-de-reticulocitos', 'fa-stethoscope', 'RECUENTO DE RETICULOCITOS', 'Para evaluar la actividad eritropoyética de la médula osea en anemias y otras condiciones hematológicas', 'Muestra de sangre no requiere ayuno', 'Se encuentra elevado en eritropoyesis activa como cuando hay regeneración. Se encuentra disminuido en condiciones de hipoplasia y deficiencias como la deficiencia de Vitamina B12. Su interpre', 'none', 'manual', '', 3, NULL, '0000-00-00 00:00:00', '2018-06-07 09:14:47'),
(61, 'recuento de plaquetas', 'recuento-de-plaquetas', 'fa-stethoscope', 'recuento de plaquetas', 'Valores bajos o trombocitopenia pueden llevar a sangrados excesivos. Valores altos o trombocitosis pueden llevar a la formación de coágulos y obstruir vasos sanguíneos con consecuencias importantes.', 'Muestra de sangre No requiere ayuno|', 'Son producto de la fragmentación citoplasmática de los megacariocitos. Poseen un papel importante en la hemostasia en la formación de coágulos y son fuente natural de factores de crecimiento.', 'none', 'none', '', 3, NULL, '0000-00-00 00:00:00', '2018-06-07 09:15:57'),
(63, 'TIEMPO DE SANGRIA', 'tiempo-de-sangria', 'fa-stethoscope', 'TIEMPO DE SANGRIA', 'Se realiza para determinar si existe trombocitopenia agregación plaquetaria y defectos en funcín plaquetaria.', NULL, 'Evalúa la integridad de los vasos paquetas y la formación del coágulo', 'none', 'observacion manual Se realiza una incisión en la parte baja de la oreja  y se deja sangrar hasta que se dete', '', 3, NULL, '0000-00-00 00:00:00', '2018-06-07 09:17:37'),
(64, 'TRANSAMINASA O', '', 'fa-stethoscope', 'Aspartato transaminasa (AST) Aspartato amino transferasa (ASAT) Transaminasa Glutamico oxalacótica (TGO/GOT) Transaminasa glutamica oxalacetica del suero (S', 'La TGO es una enzima con gran concentración en el corazón en el hígado y los músculos. Cuando hay una lesión de estos órganos la enzima es liberada a la sangre y aparece elevada en los análisis. Se realiza en el contexto de otras pruebas hepáticas (GGT ALT Bilirrubina fosfatasa alcalina) y se utiliza para evaluar problemas o alteraciones del hígado. Su elevación es directamente proporcional al daño celular y puede servir como indicativo de la evolución de la enfermedad.\nTambién se utiliza como parámetro indicador de lesión cardiaca en el contexto de otros parámetros cardiacos(CPKLDH)como indicador de lesión cardiaca por un infarto de miocardio. Su valor maximo se alcanza a las 24 horas tras el infarto y tiende a bajar en 3 a 4 días si la lesión cardiaca cede. Si persiste elevada es que el infarto está progresando a peor.', 'Muestra de sangre No requiere ayuno Edad y sexo del paciente requerido', 'Los niveles aumentados de TGO pueden indicar:\n\n* Alcoholismo\n* Anemia hemolítica\n* Colestasis (obstrucción de via biliar)\n* Cirrosis\n* Distrofias musculares\n* Enfermedades muculares\n* Hepatit', 'none', 'cinetico', '', 3, '2018-05-04 06:18:42', '0000-00-00 00:00:00', '2018-05-04 06:18:42'),
(65, 'TRANSAMINASA P', 'transaminasa-p', 'fa-stethoscope', 'Alanina Transaminasa (ALT) Alanina Amino Transferasa (ALT) Transaminasa Glutamico piruvica (TGP/GPT) Transaminasa Glutamico piruvica del suero (SGPT)', 'Es una enzima que se encuentra en mayores cantidades en el hígado. La lesión a este órgano ocasiona la liberación de la sustancia dentro de la sangre. En mucho menor proporción se encuentra actividad de ALT en: músculo esquelético corazón páncreas y eritrocitos (en orden decreciente). La actividad de ALT en eritrocitos es 6 veces superior a la del suero.\r\nLos mayores aumentos de actividad ALT en suero se producen como consecuencia de alteraciones hepáticas (colestasis hepatitis tóxicas o virales).La determinación de ALT adquiere importancia diagnóstica cuando sus valores se comparan con los de otras enzimas de similar origen tisular permitiendo así completar el perfil enzimático de órganos como el hígado.\r\nLa enzima ALT es más específica del daño hepático que el cociente AST/ALT.', 'Muestra de sangre No requiere ayuno Edad y sexo del paciente requerido', 'Un incremento en los niveles de ALT a menudo significa que la enfermedad hepática está presente.', 'none', 'cinetico', '', 3, NULL, '0000-00-00 00:00:00', '2018-06-07 09:18:54'),
(66, 'TRIGLICERIDOS', 'trigliceridos', 'fa-stethoscope', 'Triacilglicóridos o Triacilgliceroles', 'Los triglicéridos son la forma principal de grasa que se encuentra en la naturaleza y su función principal es proporcionar energía para la célula.', 'Muestra de sangre Ayuno 12 - 14 hrs No ingerir alcohol 24hrs Previas a la toma de la muestra', 'La prueba de triglicéridos suele ser parte del perfil lipídico. significa grasa. Un perfil lipídico es una prueba que mide los niveles de grasas en la sangre entre ellas los triglicéridos y e', 'none', 'colorimetrico', '', 3, NULL, '0000-00-00 00:00:00', '2018-06-07 09:19:43'),
(67, 'T3', 't3', 'fa-stethoscope', 'Triyodotironina T3 total', 'Prueba de segundo orden para hipertiroidismo en pacientes con niveles bajos de TSH y niveles normales de T4. Diagnóstico de tirotoxicosis T3', 'Muestra de sangre No requiere ayuno', '* Cirrosis (cicatrización del hígado).', 'none', 'Inmunoquimioluminiscencia', '', 3, NULL, '0000-00-00 00:00:00', '2018-06-07 09:20:50'),
(68, 'T4', 't4', 'fa-stethoscope', 'Tiroxina Tetrayodotironina T4 total Tiroxina total', 'Monitoreo del tratamiento con hormonas sinteticas (T4 sinbtpetica causa uba disminución de T4 total). Monitoreo del tratamiento de hipertiroidismo con tiouracilo y otra drogas atitiroideas. T4 total da un buen indice de fnción tiroidea cuando las globulinas transportadoras de horona tiroideas es normal o cuando no hay enfermedad no tiroidea', 'Muestra de sangre No requiere ayuno', 'Hallazgos anormales de otros análisis de tiroides tales como TSH o T3\r\nSíntomas de un hipertiroidismo \r\nSíntomas de un hipotiroidismo\r\nHipopituitarismo (la hipófisis no produce suficiente can', 'none', 'Inmunoquimioluminiscencia', '', 3, NULL, '0000-00-00 00:00:00', '2018-06-07 09:21:58'),
(69, 'TSH HORMONA TIROESTIMULANTE', 'tsh-hormona-tiroestimulante', 'fa-stethoscope', 'TSH HORMONA TIROESTIMULANTE', 'El TSH es un examen que mide la cantidad de la hormona estimulante de la tiroides (TSH por sus siglas en inglés) en la sangre. Esta hormona es producida por la hipófisis. Le ordena a la glándula tiroides producir y secretar las hormonas tiroideas en la sangre.', 'Muestra de sangre No requiere ayuno', 'signos o síntomas de  hipotiroidismo. También se utiliza para vigilar el tratamiento de estas afecciones.', 'none', 'Inmunoquimioluminiscencia', '', 3, NULL, '0000-00-00 00:00:00', '2018-06-07 09:38:55'),
(70, 'TP', 'tp', 'fa-stethoscope', 'TIEMPO DE PROTROMBINA', 'El tiempo de protombina (TP) es un examen de sangre que mide el tiempo que tarda la porción líquida de la sangre (plasma) en coagularse.', 'TOMAR APROX 4 ML DE SANGRE NO CONSUMIR ASPIRINA 12 HORAS ANTES DEL EXAMEN', 'La razón más comun para realizar este examen es controlar sus niveles cuando usted está tomando un medicamento anticoagulante llamado warfarina. Probablemente está tomando este medicamento pa', 'none', 'observacion', '', 3, NULL, '0000-00-00 00:00:00', '2018-06-07 09:43:59'),
(71, 'TRANSAMINASA O', 'transaminasa-o', 'fa-stethoscope', 'Aspartato transaminasa (AST) Aspartato amino transferasa (ASAT) Transaminasa Glutámico oxalacética (TGO/GOT), Transaminasa glutamica oxalacetica del suero (SGOT)', '\"La TGO es una enzima con gran concentración en el corazón, en el hígado y los músculos. Cuando hay una lesión de estos órganos la enzima es liberada a la sangre y aparece elevada en los análisis. Se realiza en el contexto de otras pruebas hepáticas (GGT, ALT Bilirrubina, fosfatasa alcalina) y se utiliza para evaluar problemas o alteraciones del hígado. Su elevación es directamente proporcional al daño celular y puede servir como indicativo de la evolución de la enfermedad.\r\nTambién se utiliza como parámetro indicador de lesión cardiaca en el contexto de otros parámetros cardiacos(CPK,LDH),como indicador de lesión cardiaca por un infarto de miocardio. Su valor máximo se alcanza a las 24 horas tras el infarto, y tiende a bajar en 3 a 4 días si la lesión cardiaca cede. Si persiste elevada es que el infarto está progresando a peor.\"', 'Muestra de sangre. No requiere ayuno. Edad y sexo del paciente requerido. TOMAR APROX 3 ML DE SANGRE', '\"Los niveles aumentados de TGO pueden indicar:\r\n\r\n* Alcoholismo\r\n* Anemia hemolítica\r\n* Colestasis (obstrucción de vía biliar)\r\n* Cirrosis\r\n* Distrofias musculares\r\n* Enfermedades muculares\r\n', 'hasta 42 U7L', 'cinetico', NULL, 3, NULL, '2018-05-04 06:18:26', '2018-06-07 09:45:03');
INSERT INTO `links` (`id`, `url`, `name`, `icon`, `location`, `target`, `description`, `visible`, `notes`, `parent_id`, `created_at`, `updated_at`) VALUES
(1, '/login', 'Login', 'fa-facebook', 'header', '_blank', '<p>Login al sistema administrativo</p>', '1', NULL, 0, '2018-04-25 12:29:20', '2018-04-26 03:34:14'),
(2, 'http://twitter.com', 'twitter', 'fa-twitter', 'social', '_blank', '<p>twitter</p>', '1', NULL, 0, '2018-04-25 14:29:59', '2018-04-26 03:38:49'),
(3, 'facebook.com', 'facebook', 'fa-facebook', 'social', '_blank', '<p>facebook</p>', '1', NULL, 0, '2018-04-26 05:18:32', '2018-04-26 05:18:32'),
(4, '/', 'Alianzas estratégicas con empresas en salud ocupacional', 'none', 'services', NULL, '<p><strong>Alianzas estrat&eacute;gicas con empresas en salud ocupacional por esto nos adaptamos a sus necesidades.&nbsp;Nos desplazamos hasta sus lugares de trabajo haciendo brigadas en salud ocupacional.</strong></p>', '1', NULL, 0, '2018-05-03 11:44:20', '2019-04-15 20:17:38'),
(5, '/contacto', 'Contacto', 'fa-phone', 'social', NULL, '<p>contacto</p>', '1', NULL, 0, '2018-10-11 09:54:37', '2018-10-11 09:55:26'),
(6, '/', 'Manipuladores de Alimentos', 'fa', 'services', NULL, '<p><strong>Nuestro programa es l&iacute;der en el departamento del Tolima y en Ibagu&eacute;, Ofreciendo un paquete de toma de muestras y capacitaci&oacute;n a manipuladores de alimentos. Nuestra capacitaci&oacute;n de alimentos puede ser de&nbsp;forma presencial o virtual.</strong></p>', '1', NULL, 0, '2019-04-15 20:27:05', '2019-04-15 20:27:05'),
(7, '/', 'Capacitaciones Virtuales y Presenciales', 'fa', 'services', NULL, '<p><strong>INAP AYUDAS PEDAGÓGICAS TIENE LOS PROFESIONALES NECESARIOS PARA EFECTUAR CAPACITACIONES EN DIVERSOS TEMAS:</strong></p>\r\n\r\n<p><strong>TEMAS DE CAPACITACI&Oacute;N PRESENCIAL</strong></p>\r\n\r\n<ol>\r\n	<li>Manipulaci&oacute;n de alimentos</li>\r\n	<li>Buenas practicas de Piscinas</li>\r\n	<li>PGHIRS (Gesti&oacute;n integral de residuos hospitalarios y similares)</li>\r\n	<li>Manejo de las 3R (Reusar,Reciclar,Reutilizar)</li>\r\n	<li>Cuidado de los recursos Naturales</li>\r\n	<li>Uso Racional del Agua</li>\r\n	<li>Tratamiento del Agua</li>\r\n	<li>Generalidades de las plantas de tratamiento</li>\r\n	<li>Sistemas de tratamiento de agua</li>\r\n	<li>Aguas Residuales</li>\r\n</ol>\r\n\r\n<p><strong>CURSOS ON LINE</strong></p>\r\n\r\n<ol>\r\n	<li><strong>Manejo de alimentos nivel 1</strong></li>\r\n	<li><strong>Curso de manejo de bebidas alcoholicas (En proyecci&oacute;n)</strong></li>\r\n	<li><strong>Manejo de residuos solidos y peligrosos (En proyecci&oacute;n)</strong></li>\r\n</ol>', '1', NULL, 0, '2019-04-15 20:31:55', '2019-04-15 20:31:55'),
(8, '/', 'Exámenes de Laboratorio', 'fa', 'services', NULL, '<br><p>INAP AYUDAS PEDAGÓGICAS ofrece a sus clientes toma de muestras y examenes de laboratorio - en la sede o a domicilio y procesamiento&nbsp; de pruebas de laboratorio de rutina y especializados apoyados en talento humano id&oacute;neo y profesional, en equipos automatizados y controles de calidad internos y externos para garantizar la fiabilidad de los resultados. puede conocer nuestro portafolio de laboratorios <strong><a href=\"http://portal.diagnosticar.com.co/laboratorios\">aqu&iacute;</a></strong></p>', '1', NULL, 0, '2019-04-15 20:34:23', '2019-04-15 20:36:49');
